import './Nav.css'
import myImage from '..src' 

function Nav () {
    return (
        <nav>
            <img src={myImage} alt="React Icon" />
            <ul>
                <li>Pricing</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    )
}

export default Nav;
